import React from 'react';

const navbar = () => {
    return (
        <nav>
            <div className="container">
                <a> how how </a>
                <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="porfilio">about</a></li>
                    <li><a href="contact">contact</a></li>
                </ul>
            </div>
        </nav>
    )
}

export default navbar;
